import react from 'react'

const LoginForm = () => {
    return (
            <form>
                    <div>
                        <input placeholder='login'/>
                    </div>
                    <div>
                        <input placeholder='password'/>
                    </div>
                    <div>
                        <input placeholder='remember me' type='checkbox'/>
                    </div>
                    <button>registration</button>
            </form>
       )
}
const Login = () => {
    return (
        <div>
            <h1>Registration form</h1>
            <LoginForm/>
        </div>
    )
}

export default Login
